import React, { Component } from 'react';
import { myFavoriteModels, searchAllModels } from './services/apiService';
import Card from './components/card/card'
import './App.css';

class App extends Component {
    constructor() {
        super();
        this.state = {
            error: undefined,
            isLoaded: false,
            models: {
                cursors: {},
                next: undefined,
                previous: null,
                results: []
            }
        };
    }
    componentDidMount() {
        myFavoriteModels()
            .then((myFavoritesResponse) => {
                // console.log(myFavoritesResponse);
                this.setState({
                    isLoaded: true,
                    models: myFavoritesResponse
                });
        })
        searchAllModels()
            .then((searchResponse) => {
                // console.log(searchResponse);
            });
    }
    render() {
        const { error, isLoaded, models } = this.state;
        return (
            <div className="App">
                <div className="card_list">
                    {models.results.map(result => (
                        <Card key={result.uid} model={result}></Card>
                    ))}
                </div>
            </div>
        );
    }
}

export default App;
